import React, { useState } from "react";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";

const UploadPage = () => {
  return (
    <>
      <Header />
      <h2>내 방 올리기</h2>

      <button type="submit">매물 등록</button>
      <Footer />
    </>
  );
};

export default UploadPage;
